import { StyleSheet} from 'react-native';

const stylesLogin = StyleSheet.create({
    login:{
        backgroundColor: '#080909',
        width: '100%',
        height: '100%'
    },
    textinputUser:{
        borderColor: 'grey',
        borderWidth: 2,
        marginTop: '100%',
        width: '60%',
        alignSelf: 'center',
        borderRadius: 3
    },
    textinputPassword:{
        borderColor: 'grey',
        borderWidth: 2,
        marginTop: '7%',
        width: '60%',
        alignSelf: 'center',
        borderRadius: 3
    },
    logo:{
        flex: 1,
        aspectRatio: 0.5, 
        resizeMode: 'contain',
    }
});

export default stylesLogin;
